    super();
    this.state = {
      serverCheck: false,
      serverHealthy: false,
      questions: []
    };
  }

  async componentDidMount() {
    try {
      const health = await healthCheck();
      console.log(health);
      if(health.status === "OK"){
        this.setState({
          serverCheck: true,
          serverHealthy: true
        });
      } else {
        this.setState({
          serverCheck: true,
        });
      }

    } catch (error) {
      console.log(error);
      console.log('Error in service.');
    }
  }

render() {
